import React from "react";
import line from "../images/line.png";

function SideHeader() {
  return (
    <div>
      <div style={{ textAlign: "center", color: "#474444", fontWeight: "600" }}>
        <p style={{ marginTop: "4vh", fontSize: "2em" }}>QUIZZIE</p>
        <p style={{ marginTop: "24vh", fontSize: "1.4em" }}>Dashboard</p>
        <p style={{ marginTop: "8vh", fontSize: "1.4em" }}>Analytics</p>
        <p style={{ marginTop: "8vh", fontSize: "1.4em" }}>Create Quiz</p>
        <p style={{marginTop:"25vh"}}><img src={line} alt="line"/></p>
        <p
          style={{ marginTop: "1.7vh", fontSize: "1.6em", marginBottom: "2vh" }}
        >
          Logout
        </p>
      </div>
    </div>
  );
}

export default SideHeader;
